import React from 'react'
import {useNavigate} from 'react-router-dom';

const About = () => {

const navigate = useNavigate()

  return (
    <div className='about'>
       <h2>
        About Page
      </h2>

      <button 
      onClick={()=> navigate('/')}
      className='btn_css'>
        Go Back
      </button>
    </div>
  )
}

export default About
